(127, 'Dollar Slim Purse Money Clip Wallet', 0, 100, '<ul><li>Product: Men\'s Wallet</li><li>Color: Black, Khaki, Dark Brown and Light Brown</li><li>Main Material: PU</li><li>Closure Type: No Zipper</li></ul>', '<div>Interior: Passcard Pocket</div><div>Interior: Photo Holder</div><div>Interior: Interior Zipper Pocket</div><div>Interior: Zipper Poucht</div><div>Interior: Coin Pocket</div><div>Interior: Interior Compartment</div><div>Interior: Interior Slot Pocket</div><div>Interior: Note Compartment</div><div>Interior: Card Holder</div><div>Wallet Length: Short</div><div>Wallets: Standard Wallets</div><div>Item Length: 12cm</div><div>Pattern Type: Solid</div><div>Item Width: 10cm</div><div>Decoration: None</div><div>Gender: MEN</div><div>Item Weight: 120g</div><div>Style: vintage</div><div>Item Height: 2cm</div><div>Material Composition: PU</div><div>Lining Material: Polyester</div>', '550.00', '550.00', 'leather_wallet20.jpg', 1, 1, '2020-09-24 07:13:19', '2022-01-06 04:19:13'),
(128, 'Leather Long Wallet Cum Mobile Cover', 0, 100, '<ul><li>Main Material: 100% Genuine Leather.</li><li>Pocket: 2 Big pocket for Mobile and Money and also having an extra chain pocket for safety coin and money. 14 card slots with a mirror slot.</li><li>Measurement: 7.25 Inches long and 4 Inches Wide.</li><li>Outlook: Stylish Design</li><li>Inside: Multicolor</li></ul>', '<span style=\"font-family: Roboto, -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 14px; white-space: pre-wrap;\">Men\'s leather wallet designed to be 2 Big pocket for Mobile and Money also having a extra chain pocket for safetycoin and money. 14 card slots with a mirror slot,Plain pattern is very fancy when you take it out. On the other hand, top of this GS7 long wallet you find a unique and stylish card slot.</span>', '450.00', '450.00', 'leather_wallet12.jpg', 1, 1, '2020-09-24 07:13:53', '2021-03-07 10:10:54'),
(129, 'Leather Wallet Bag for Mobile/Card Holder', 0, 100, '<ul><li>New and unique fashionable design</li><li>High quality PU leather bag with perfect card slot</li><li>Look simple and gorgeous, multi-functional</li><li>Magnetic closure button in the middle</li></ul>', '<p data-spm-anchor-id=\"a2a0e.pdp.product_detail.i5.23121594ly8rme\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: 14px; font-family: Roboto, -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\">Buy Zhuse X series leather wallet bag for iPhone and smartphones from our online store with just one click. Home delivery is available in Dhaka, can buy it from anywhere in Bangladesh.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: 14px; font-family: Roboto, -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, sans-serif;\"><span style=\"margin: 0px; padding: 0px; font-weight: bolder;\">Key features</span></p><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; list-style: none; font-family: Roboto, -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 12px;\"><li style=\"margin: 0px; padding: 0px;\">New and unique fashionable design</li><li style=\"margin: 0px; padding: 0px;\">High quality PU leather bag with perfect card slot</li><li style=\"margin: 0px; padding: 0px;\">Look simple and gorgeous, multi-functional</li><li data-spm-anchor-id=\"a2a0e.pdp.product_detail.i4.23121594ly8rme\" style=\"margin: 0px; padding: 0px;\">Magnetic closure button in the middle</li></ul>', '599.00', '450.00', 'leather_wallet14.jpg', 1, 1, '2020-09-24 07:14:30', '2020-12-19 13:22:13'),
(130, 'ORIENT Leather Wallet For Men', 0, 100, '<ul><li>Product Type - Wallet &amp; Card Holder</li><li>High Quality PU Leather</li><li>Two Pockets for currency</li><li>Additional 6 Debit or Credit Card Slot Slots for card holders, ids etc</li><li>Elegant and Attractive Design</li><li>6 Debit or Credit Card Slot</li><li>Dimensions: H: 1.5 cm X L: 12 cm X W: 9.5 cm (approximately)</li></ul>', '<div>Luxury Wallet for Men</div><div>100% Brand New &amp; Top Quality</div><div>Leather: Bangladeshi Cowhide</div><div>Weight: 0.25kg</div><div>Slots:External Phone Wallet, full size bill slots -12 card holders</div><div>Very Durable (At least 5 Years) and it should last a life time.</div>', '550.00', '550.00', 'leather_wallet10.jpg', 1, 1, '2020-09-24 07:15:25', '2020-12-19 13:22:29'),
(131, 'Wallet Short Slim Male', 0, 100, '<ul><li>Main Material: PU</li><li>Closure Type: No Zipper</li><li>Interior: Photo Holder</li><li>Interior: Note Compartment</li><li>Interior: Card Holder</li><li>Wallet Length: Short</li><li>Wallets: Clutch Wallets</li><li>Item Length: 12cm</li><li>Pattern Type: Dot</li><li>Item Type: Wallet</li><li>Item Width: 9.5cm</li></ul>', '<div>Decoration: None</div><div>Gender: Men</div><div>Item Weight: 80g</div><div>Style: vintage</div><div>Item Height: 2cm</div><div>Material Composition: PU</div><div>Lining Material: Polyester</div><div>Applicable Gender: man/boys/ students</div><div>Occasion: Business /Party/Street/shopping</div>', '450.00', '450.00', 'leather_wallet13.jpg', 1, 1, '2020-09-24 07:16:11', '2020-12-19 13:23:07'),
(132, 'Wallet for Men', 0, 100, '<ul><li>OriginalBaellerry Brand Wallet</li><li>Size: 12.0 cm * 10.0 cm</li><li>Fine interior design large capacity can hold many of your little stuff.</li><li>High-quality PU leather quality assurance.</li><li>Cabinet display and fashion style.</li></ul>', '<ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; list-style: none; font-family: Roboto, -apple-system, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, Helvetica, sans-serif; font-size: 12px;\"><li id=\"product-prop-200000062\" style=\"margin: 0px; padding: 0px;\">Item Height:12cm</li><li id=\"product-prop-100004114\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i4.1b5b27f2s94s77\" style=\"margin: 0px; padding: 0px;\">Lining Material:Polyester</li><li id=\"product-prop-200000400\" style=\"margin: 0px; padding: 0px;\">Material Composition:Synthetic Leather</li><li id=\"product-prop-200000808\" style=\"margin: 0px; padding: 0px;\">Interior:Coin Pocket, Interior Compartment, Photo Holder, Interior Zipper Pocket, Interior Slot Pocket, Note Compartment, Zipper Poucht, Card Holder</li><li id=\"product-prop-200000063\" style=\"margin: 0px; padding: 0px;\">Item Length:10cm</li><li id=\"product-prop-318\" style=\"margin: 0px; padding: 0px;\">Gender:Men</li><li id=\"product-prop-20205\" style=\"margin: 0px; padding: 0px;\">Main Material:PU</li><li id=\"product-prop-19150\" style=\"margin: 0px; padding: 0px;\">Decoration:None</li><li id=\"product-prop-200007726\" style=\"margin: 0px; padding: 0px;\">Wallet Length:Short</li><li id=\"product-prop-200000388\" style=\"margin: 0px; padding: 0px;\">Closure Type:Zipper &amp; Hasp</li><li id=\"product-prop-200000064\" style=\"margin: 0px; padding: 0px;\">Item Weight:115 g</li><li id=\"product-prop-200000329\" style=\"margin: 0px; padding: 0px;\">Pattern Type:Solid</li><li id=\"product-prop-326\" style=\"margin: 0px; padding: 0px;\">Style:Casual</li><li id=\"product-prop-200000065\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i3.1b5b27f2s94s77\" style=\"margin: 0px; padding: 0px;\">Item Width:3 cm</li></ul>', '550.00', '550.00', 'leather_wallet22.jpg', 1, 1, '2020-09-24 07:17:12', '2020-12-19 13:23:25'),
