(194, 'Power XoLite Racer Dart for Men', 0, 10, '<p><span style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\">Made to fly, XoLite Racer is Powers newest lightweight high-speed running shoe. Featuring a streamlined design with a high toe spring and a curved heel, this shoe has an undeniable aerodynamic edge. Our designers formulated XoLite, a midsole foam that is 20% lighter with...</span><br></p>', '<p><em style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\"><strong>XoLite Racer</strong></em><br style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\"><em style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\">Ready. Set. Fly!</em><span style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\"></span><br style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\"><br style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\"><span style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\">Made to fly, XoLite Racer is Powers newest lightweight high-speed running shoe. Featuring a streamlined design with a high toe spring and a curved heel, this shoe has an undeniable aerodynamic edge. Our designers formulated XoLite, a midsole foam that is 20% lighter with great cushioning for ultimate impact protection at high speeds.</span><br style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\"><br style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\"><br style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\"><strong style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\">FEATURES:</strong><br style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\"><span style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\">- XoLite midsole compound for 20% lighter cushioning</span><br style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\"><span style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\">- Sharp angles to generate wind flow lending into an aerodynamic design</span><br style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\"><span style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\">- Rubber outsole plates for traction</span><br style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\"><span style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\">- Engineered mesh upper</span><br style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\"><span style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\">- Curved back collar to prevent Achilles abrasion</span><br style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\"><br style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\"><strong style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\">STYLE TIP</strong><br style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\"><span style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\">Conjure up the sight of fitness freaks with this pair of avant-garde shoes that are sure to give you an up to date look with almost all your gym and training wear.</span><br style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\"><br style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\"><strong style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\">CARE INSTRUCTIONS</strong><br style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\"><span style=\"color: rgb(45, 45, 45); font-family: Roboto; font-size: 12px;\">Remove excess dirt first using a soft-bristled brush (shoe brush or old toothbrush) to clean the outsole. Mix warm water and a small amount of laundry detergent to create a slightly soapy mixture. Apply a small amount of the water/detergent mixture to a sponge, soft cloth or soft brush